import styled from "styled-components";

const Container = styled.div`
  width: 400px;
  margin: 40px auto;
`;

function JoinSpace() {
  return (
    <Container>
      <header>
        <img alt="이전" />
        <div>가입하기</div>
      </header>
      <div>
        <div>이메일</div>
        <div>비밀번호</div>
        <button>회원가입</button>
      </div>
    </Container>
  );
}

export default JoinSpace;
